	public static double getData(String data)
	{
		return getData(  data,  false);
	}
	
	
	public static double getData(String data,boolean is5)
	{
		data = getDataStr(data);
		float c = 0;
		if(is5 && data.contains(".") && data.length()-data.indexOf(".")>4 )
		{
			int a = Integer.parseInt(data.substring(data.indexOf(".")+3, data.indexOf(".")+4));
			
			if(a >= 5)
				c=0.01f;
		}
		double data1 = Double.parseDouble(data)+c;
		return data1;
	}

	public static String getDataStr(String data )
	{
		if(data.contains("e") || data.contains("E"))
		{
	        BigDecimal bd = new BigDecimal(data);  
	        data=bd.toPlainString();
		}
		
		if(data.contains(".") && data.length()-data.indexOf(".")>5 )
		{
			data = data.substring(0, data.indexOf(".")+5);
		}
		return data;
	}

	public static String getDataStr2(double data1  )
	{
		String data = data1+"";
		if(data.contains("e") || data.contains("E"))
		{
	        BigDecimal bd = new BigDecimal(data);  
	        data=bd.toPlainString();
		}
		
		if(data.contains(".") && data.length()-data.indexOf(".")>3 )
		{
			data = data.substring(0, data.indexOf(".")+3);
		}
		return data;
	}
	
	

